class NotificationsComponent {
    constructor(api, toastyService, router) {
        this.api = api;
        this.toastyService = toastyService;
        this.router = router;
        const param = {
            id: localStorage.getItem('uid')
        };
        this.api.auth(param).then((data) => {
            console.log('auth data->>', data);
            if (data !== true) {
                localStorage.removeItem('uid');
                this.router.navigate(['login']);
            }
        }, error => {
            console.log(error);
            localStorage.removeItem('uid');
            this.router.navigate(['login']);
        }).catch((error) => {
            console.log(error);
            localStorage.removeItem('uid');
            this.router.navigate(['login']);
        });
    }
    ngOnInit() {
    }
    send() {
        if (!this.title || !this.descriptions) {
            this.error(this.api.translate('All Fields are required'));
            return false;
        }
        this.api.sendNotification(this.descriptions, this.title).subscribe((data) => {
            console.log(data);
            this.title = '';
            this.descriptions = '';
            this.success(this.api.translate('Notications sent'));
        }, error => {
            console.log(error);
            this.error(this.api.translate('Something went wrong'));
        });
    }
    error(message) {
        const toastOptions = {
            title: this.api.translate('Error'),
            msg: this.api.translate(message),
            showClose: true,
            timeout: 2000,
            theme: 'default',
            onAdd: (toast) => {
                console.log('Toast ' + toast.id + ' has been added!');
            },
            onRemove: () => {
                console.log('Toast  has been removed!');
            }
        };
        // Add see all possible types in one shot
        this.toastyService.error(toastOptions);
    }
    success(message) {
        const toastOptions = {
            title: this.api.translate('Success'),
            msg: this.api.translate(message),
            showClose: true,
            timeout: 2000,
            theme: 'default',
            onAdd: (toast) => {
                console.log('Toast ' + toast.id + ' has been added!');
            },
            onRemove: () => {
                console.log('Toast  has been removed!');
            }
        };
        // Add see all possible types in one shot
        this.toastyService.success(toastOptions);
    }
}


